import React from 'react'

function App(){

    const table = {
        width: '100%',
        borderCollapse: 'collapse'
    }
const tableHeadRow={
    border: '1px solid #dddddd',
    padding: '10px',
    textAlign: 'left'
}
    

    const bioData = [
        {name: 'Jack', age: 24, language: 'English', address: [{
            Hno: 13, city: 'Mumbai', state: 'Maharashtra'
        }, {
            Hno: 14, city: 'Dehradun', state: 'Uttrakhand'
        }, {
            Hno: 15, city: 'Mohali', state: 'Punjab'
        }]},
        {name: 'James', age: 26, language: 'Russian', address: [{
            Hno: 13, city: 'Mumbai', state: 'Maharashtra'
        }, {
            Hno: 14, city: 'Dehradun', state: 'Uttrakhand'
        }, {
            Hno: 15, city: 'Mohali', state: 'Punjab'
        }]},
        {name: 'Rostov', age: 28, language: 'Spanish', address: [{
            Hno: 13, city: 'Mumbai', state: 'Maharashtra'
        }, {
            Hno: 14, city: 'Dehradun', state: 'Uttrakhand'
        }, {
            Hno: 15, city: 'Mohali', state: 'Punjab'
        }]}
    ]   

return(
    <>
    <h1>Nested List With Nested Array</h1>
    
{
bioData.map((data)=>{
    return(
        <>
<table style={table}>
<thead>

<tr>
    <th style={tableHeadRow}>Name</th>
    <th style={tableHeadRow}>Age</th>
    <th style={tableHeadRow}>Language</th>
    <th style={tableHeadRow}>Address</th>


</tr>
</thead>
    <tbody>
<tr>
    <td style={tableHeadRow}>{data.name}</td>
    <td style={tableHeadRow}>{data.age}</td>
    <td style={tableHeadRow}>{data.language}</td>
    <td style={tableHeadRow}>{data.map((item)=>{
        <tr>
            <td>{item.Hno}</td>
            <td>{item.city}</td>
            <td>{item.state}</td>

        </tr>

    })}</td>



</tr>

</tbody>

</table>
</>
)
})

}
    </>
)
}

export default App
